CREATE TABLE ativo
(
    id                  UUID         NOT NULL,
    version             SMALLINT     NOT NULL DEFAULT 0,
    created_at          TIMESTAMP    NOT NULL DEFAULT now(),
    updated_at          TIMESTAMP    NOT NULL DEFAULT now(),
    codigo_ativo        VARCHAR(128) NOT NULL,
    nome                VARCHAR(128),
    descricao           VARCHAR(1024),
    setor               VARCHAR(128),
    site                VARCHAR(128),
    tipo                VARCHAR(255) NOT NULL,
    preco               numeric(20, 10),
    investing_url       VARCHAR(255),
    cnpj                VARCHAR(255),
    nome_fonte_pagadora VARCHAR(255),
    cnpj_fonte_pagadora VARCHAR(255),
    data_cotacao        TIMESTAMP,
    fetch_counter       BIGINT,

    CONSTRAINT ativo_pk PRIMARY KEY (id)
);



update ativo
set data_cotacao=(NOW() - interval '12 hour'),
    fetch_counter=0,
    version=0;





